-- Export SQL pentru Utilizatori - Wave 2.0 → Wave 3.0
-- Rulează aceste query-uri în phpMyAdmin/cPanel pentru a vedea structura și datele

-- ==========================================
-- 1. ANALIZA ROLURILOR
-- ==========================================

-- Vedere generală roluri
SELECT 
    id,
    name,
    display_name,
    created_at,
    updated_at
FROM roles 
ORDER BY id;

-- Statistici utilizatori pe roluri
SELECT 
    r.name as role_name,
    r.display_name,
    COUNT(ur.user_id) as users_count
FROM roles r
LEFT JOIN user_roles ur ON r.id = ur.role_id
GROUP BY r.id, r.name, r.display_name
ORDER BY users_count DESC;

-- ==========================================
-- 2. ANALIZA UTILIZATORILOR
-- ==========================================

-- Utilizatori cu rolurile lor
SELECT 
    u.id,
    u.name,
    u.email,
    u.email_verified_at,
    u.created_at,
    r.name as role_name,
    r.display_name as role_display_name
FROM users u
LEFT JOIN user_roles ur ON u.id = ur.user_id
LEFT JOIN roles r ON ur.role_id = r.id
ORDER BY u.created_at DESC
LIMIT 20;

-- Utilizatori fără roluri (problematici)
SELECT 
    u.id,
    u.name,
    u.email,
    u.created_at
FROM users u
LEFT JOIN user_roles ur ON u.id = ur.user_id
WHERE ur.user_id IS NULL;

-- Utilizatori cu multiple roluri (problematici pentru Wave 3.0)
SELECT 
    u.id,
    u.name,
    u.email,
    COUNT(ur.role_id) as roles_count,
    GROUP_CONCAT(r.name) as role_names
FROM users u
JOIN user_roles ur ON u.id = ur.user_id
JOIN roles r ON ur.role_id = r.id
GROUP BY u.id, u.name, u.email
HAVING roles_count > 1;

-- ==========================================
-- 3. ANALIZA PERMISIUNILOR (pentru referință)
-- ==========================================

-- Permisiuni pe roluri
SELECT 
    r.name as role_name,
    COUNT(pr.permission_id) as permissions_count
FROM roles r
LEFT JOIN permission_roles pr ON r.id = pr.role_id
GROUP BY r.id, r.name
ORDER BY permissions_count DESC;

-- Top permisiuni folosite
SELECT 
    p.key as permission_key,
    p.table_name,
    COUNT(pr.role_id) as roles_count
FROM permissions p
LEFT JOIN permission_roles pr ON p.id = pr.permission_id
GROUP BY p.id, p.key, p.table_name
ORDER BY roles_count DESC
LIMIT 10;

-- ==========================================
-- 4. VERIFICĂRI INTEGRITATE
-- ==========================================

-- Verifică email-uri duplicate
SELECT 
    email,
    COUNT(*) as count
FROM users
GROUP BY email
HAVING count > 1;

-- Verifică utilizatori activi (recent logați)
SELECT 
    COUNT(*) as total_users,
    COUNT(email_verified_at) as verified_users,
    COUNT(CASE WHEN created_at >= DATE_SUB(NOW(), INTERVAL 1 YEAR) THEN 1 END) as recent_users,
    COUNT(CASE WHEN avatar IS NOT NULL THEN 1 END) as users_with_avatar
FROM users;

-- ==========================================
-- 5. EXPORT PENTRU IMPORT (Runează separat)
-- ==========================================

-- Export roles (copiază rezultatul)
SELECT 
    CONCAT(
        'INSERT INTO `roles` VALUES (',
        id, ',\'', 
        REPLACE(name, '\'', '\\\''), '\',\'',
        REPLACE(IFNULL(display_name, ''), '\'', '\\\''), '\',\'',
        IFNULL(created_at, 'NULL'), '\',\'',
        IFNULL(updated_at, 'NULL'), '\');'
    ) as sql_insert
FROM roles
ORDER BY id;

-- Export users (primii 10 pentru test)
SELECT 
    CONCAT(
        'INSERT INTO `users` VALUES (',
        id, ',\'', 
        REPLACE(name, '\'', '\\\''), '\',\'',
        REPLACE(email, '\'', '\\\''), '\',',
        CASE WHEN email_verified_at IS NULL THEN 'NULL' ELSE CONCAT('\'', email_verified_at, '\'') END, ',\'',
        password, '\',',
        CASE WHEN remember_token IS NULL THEN 'NULL' ELSE CONCAT('\'', remember_token, '\'') END, ',',
        CASE WHEN created_at IS NULL THEN 'NULL' ELSE CONCAT('\'', created_at, '\'') END, ',',
        CASE WHEN updated_at IS NULL THEN 'NULL' ELSE CONCAT('\'', updated_at, '\'') END, ',',
        CASE WHEN avatar IS NULL THEN 'NULL' ELSE CONCAT('\'', REPLACE(avatar, '\'', '\\\''), '\'') END, ',',
        CASE WHEN settings IS NULL THEN 'NULL' ELSE CONCAT('\'', REPLACE(settings, '\'', '\\\''), '\'') END,
        ');'
    ) as sql_insert
FROM users
ORDER BY id
LIMIT 10;

-- Export user_roles
SELECT 
    CONCAT(
        'INSERT INTO `user_roles` VALUES (',
        user_id, ',',
        role_id, ');'
    ) as sql_insert
FROM user_roles
ORDER BY user_id;

